    // unicode reader luposdate3000
    private var kpIndex: Long = 0
    private var kpLineNumber: Long = 1
    private var kpColumnNumber: Long = 1

    private var kpUnmarkedIndex: Long = 0
    private var kpUnmarkedLineNumber: Long = 0
    private var kpUnmarkedColumnNumber: Long = 1

    private val kpInputstream: IMyInputStream = kpInputstream

    private var kpBufMark = 0
    private var kpBufHead = 0
    private var kpBufTail = 0
    private var kpBuffer = ByteArray(kpBufferSize)

    private var kpBytesLeft = kpInputstream.read(kpBuffer, 0, kpBufferSize / 2)
    private var kpEndApproaching = false

    private inline fun kpBufferHasNext(): Boolean {
        return kpBytesLeft > 0
    }

    private inline fun kpBufferUpdateIndex(isLineBreak: Boolean) {
        kpUnmarkedIndex++
        if (isLineBreak) {
            kpUnmarkedColumnNumber = 1
            kpUnmarkedLineNumber++
        } else {
            kpUnmarkedColumnNumber++
        }
    }

    /**
     * nextInt with low domain (0-255) and high domain (256-...)
     * lambdas have to return appropriate values
     */
    private inline fun kpBufferNextInt(lowDomain: (Int) -> Int, highDomain: (Int) -> Int): Int { // this is for UTF-8
        val firstByte = kpBuffer[kpBufHead].toInt()
        var returnValue: Int = 0
        if (firstByte < 0b10000000) { // one byte
            returnValue = firstByte
            kpBufHead += 1
            kpBytesLeft -= 1
            kpBufferUpdateIndex(firstByte == 0x0A)
            kpBufferUpdate()
            return lowDomain(returnValue)
        } else {
            val secondByte = kpBuffer[kpBufHead + 1].toInt() and 0b00111111
            if (firstByte and 0b11100000 == 0b11000000) { // two bytes
                returnValue = ((firstByte and 0b00011111) shl 6) or (secondByte)
                kpBufHead += 2
                kpBytesLeft -= 2
                kpBufferUpdateIndex(false)
            } else {
                val thirdByte = kpBuffer[kpBufHead + 2].toInt() and 0b00111111
                if (firstByte and 0b11110000 == 0b11100000) { // three bytes
                    returnValue = ((firstByte and 0b00001111) shl 12) or (secondByte shl 6) or (thirdByte)
                    kpBufHead += 3
                    kpBytesLeft -= 3
                    kpBufferUpdateIndex(false)
                } else {
                    val fourthByte = kpBuffer[kpBufHead + 3].toInt() and 0b00111111
                    if (firstByte and 0b11111000 == 0b11110000) { // four bytes
                        returnValue =
                            ((firstByte and 0b00000111) shl 18) or (secondByte shl 12) or (thirdByte shl 6) or (fourthByte)
                        kpBufHead += 4
                        kpBytesLeft -= 4
                        kpBufferUpdateIndex(false)
                    }
                }
            }
            kpBufferUpdate()
            return highDomain(returnValue)
        }
    }

    private inline fun kpBufferNextInt(): Int { // this is for UTF-8
        val firstByte = kpBuffer[kpBufHead].toInt()
        var returnValue: Int = 0
        if (firstByte < 0b10000000) { // one byte
            returnValue = firstByte
            kpBufHead += 1
            kpBytesLeft -= 1
            kpBufferUpdateIndex(firstByte == 0x0A)
        } else {
            val secondByte = kpBuffer[kpBufHead + 1].toInt() and 0b00111111
            if (firstByte and 0b11100000 == 0b11000000) { // two bytes
                returnValue = ((firstByte and 0b00011111) shl 6) or (secondByte)
                kpBufHead += 2
                kpBytesLeft -= 2
                kpBufferUpdateIndex(false)
            } else {
                val thirdByte = kpBuffer[kpBufHead + 2].toInt() and 0b00111111
                if (firstByte and 0b11110000 == 0b11100000) { // three bytes
                    returnValue = ((firstByte and 0b00001111) shl 12) or (secondByte shl 6) or (thirdByte)
                    kpBufHead += 3
                    kpBytesLeft -= 3
                    kpBufferUpdateIndex(false)
                } else {
                    val fourthByte = kpBuffer[kpBufHead + 3].toInt() and 0b00111111
                    if (firstByte and 0b11111000 == 0b11110000) { // four bytes
                        returnValue =
                            ((firstByte and 0b00000111) shl 18) or (secondByte shl 12) or (thirdByte shl 6) or (fourthByte)
                        kpBufHead += 4
                        kpBytesLeft -= 4
                        kpBufferUpdateIndex(false)
                    }
                }
            }
        }
        kpBufferUpdate()
        return returnValue
    }

    private inline fun kpBufferUpdate() {
        if (kpBytesLeft <= 4 && !kpEndApproaching) {
            // allocate more space
            if (kpBufHead + kpBytesLeft + kpBufferSize > kpBuffer.size) {
                kpBuffer += ByteArray(kpBufferSize)
            }
            val newBytes = kpInputstream.read(kpBuffer, kpBufHead + kpBytesLeft, kpBufferSize)
            if (newBytes > 0) {
                kpBytesLeft += newBytes
            } else {
                kpEndApproaching = true
            }
        }
    }

    private inline fun kpBufferMark() {
        kpLineNumber = kpUnmarkedLineNumber
        kpColumnNumber = kpUnmarkedColumnNumber
        kpIndex = kpUnmarkedIndex
        kpBufMark = kpBufHead
    }

    private inline fun kpBufferRetrieve(drop: Int = 0, dropLast: Int = 0): String {
        return kpBuffer.decodeToString(kpBufTail + drop, kpBufMark - dropLast)
    }

    private inline fun kpBufferReset() {
        if (kpBufHead > kpBufferSize / 2) {
            kpBuffer.copyInto(kpBuffer, 0, kpBufMark, kpBufHead + kpBytesLeft)
            kpBytesLeft += kpBufHead - kpBufMark
            kpBufHead = 0
            kpBufMark = 0
            kpBufTail = 0
        } else {
            kpBytesLeft += kpBufHead - kpBufMark
            kpBufTail = kpBufMark
            kpBufHead = kpBufTail
        }
        kpUnmarkedLineNumber = kpLineNumber
        kpUnmarkedColumnNumber = kpColumnNumber
        kpUnmarkedIndex = kpIndex
    }


