    private fun kpScannerNextToken(startNode: Int) {
        while (true) {
            kpBufferReset()
            kpScannerLastTokenId = Int.MAX_VALUE

            var currentNode = startNode
            while (currentNode != 0) {
                currentNode = kpScannerNextNode(currentNode)
            }
            when (kpScannerLastTokenId) {
