                    kpScannerLastToken = STRING_37; kpScannerLastImage = "DEFAULT"
                }
                -111 -> {
                    kpScannerLastToken = STRING_25; kpScannerLastImage = "CLEAR"
                }
                -110 -> {
                    kpScannerLastToken = STRING_93; kpScannerLastImage = "ISIRI"
                }
                -109 -> {
                    kpScannerLastToken = STRING_4; kpScannerLastImage = "REDUCED"
                }
                -108 -> {
                    kpScannerLastToken = STRING_76; kpScannerLastImage = "MINUTES"
                }
                -107 -> {
                    kpScannerLastToken = STRING_111; kpScannerLastImage = "FALSE"
                }
                -106 -> {
                    kpScannerLastToken = STRING_30; kpScannerLastImage = "MOVE"
